import Embed from "../Project-Components/Embed.js"

import currentLinks from "../Project-Components/currentLinks.js";

import Header from "./Header.js"

export default function WEC() {
    return (
 
  <div>
     <Header type = {"Information Design"} title = {"World Economic Forum Site Design"} desc = {"View Prototype"} src = {"./content/Images-Profile/WEC.png"} link = {"https://www.figma.com/proto/MUQPWZrCKchjPh5e3rMP3R/Portfolio?node-id=207%3A44858&page-id=207%3A44795&scaling=min-zoom&starting-point-node-id=207%3A44957&viewport=1040%2C583%2C0.05"}/>
     <div className = "page-content">
      <div className = "content-flex">
        <currentLinks />
      </div>
     </div>
  </div>
    );
}
